import React, { useState, useContext } from "react";
import { Tabs, Tab } from "@mui/material";
import UserContext from "../../context/UserContext";

function MyLibraryNav() {

    // context de default olrak açılacak tabsı ayarlıyorum.
    const { tabs } = useContext(UserContext);

    const [activeTab, setActiveTab] = useState(tabs);

    const handleChange = (event, newValue) => {
        setActiveTab(newValue);

    };

    return (
        <>
            <Tabs value={activeTab} onChange={handleChange}>
                <Tab value="magaza" label="Mağaza" />
                <Tab value="mylibrary" label="Kütüphanem" />
            </Tabs>
            {activeTab === "magaza" && (
                <div>Mağaza sayfası</div>
            )}
            {activeTab === "mylibrary" && (
                <div>Kütüphanem sayfası</div>
            )}
        </>
    );
}

export default MyLibraryNav;
